import './Card.css';
import { useState, useEffect } from 'react';

const Card = ({ team }) => {
  const [info, setInfo] = useState([]);
  const teamInfo = [Object.entries(team)];

  useEffect (() => {
   setInfo(teamInfo);
  }, teamInfo);

  return (
    <section className='cards'>
      <div>{team.name}</div>
      <div>{info.venue}</div>

    </section>
  )
};

export default Card;
